import React from 'react';
import { v4 as uuidv4 } from 'uuid';
import './Admin.css';
import {
	createAvatarObject,
	AvatarProps,
} from './Login/Components/Auth/Carousel/genAvatars';

const generatePseudo = () => {
	const chars = 'abcdefghijklmnopqrstuvwxyz';
	let pseudo = '';
	for (let i = 0; i < 8; i++) {
		pseudo += chars[Math.floor(Math.random() * chars.length)];
	}
	return pseudo;
};

const Admin = () => {
	const avatar = createAvatarObject(uuidv4());
	const pseudo = generatePseudo();

	const handleCLick = () => {
		console.log(generatePseudo());
		try {
			axios.post(
				'http://localhost:3333/auth/admin/create',
				{
					avatar,
					pseudo,
				},
				{ withCredentials: true }
			);
		} catch (error) {
			console.log(error);
		}
	};

	return (
		<div className="admin-wrapper">
			<button onClick={handleCLick}>Send</button>
		</div>
	);
};

export default Admin;
